function ModalItem( props ) {  
  const { orderHeader,handeOrderLine } = props
  return (
      orderHeader && orderHeader.length > 0 ?
      orderHeader.map((item,index) => {
      return (
        <tr key={index}>
           <td>{item.STT}</td>
           <td>{item.KhuVuc}</td>
           <td value={item.MaDH} onClick={()=>handeOrderLine(item.MaDH)}  data-bs-dismiss="modal">{item.MaDH}</td>
           <td>{item.MaKH}</td>
           <td>{item.TenKH}</td>
           <td>{ item.TrangThai === "0" ? <span >Chưa soạn</span> 
               : item.TrangThai === "1" ? <span>Đang soạn</span> 
               : <span style={{"color":"333333"}} >Hoàn tất</span> 
               }</td>
        </tr>
      )
    })
    :
    <tr>
        <td colSpan={6} style={{'textAlign':'center',"color":"red"}}>Không có dữ liệu</td>
    </tr>
  );
}

export default ModalItem;
